import React from 'react';
import {Table} from 'react-bootstrap';



const Group=() =>{
  return(
<Table striped bordered hover>
  <thead>
    <tr>
      <th>#</th>
      <th>{this.props.obj._id}</th>
      <th>{this.props.obj.name}</th>
      <th>{this.props.obj.description}</th>
    </tr>
  </thead>



</Table>
)
}
export default Group;
